import React from "react";
import propTypes from "prop-types";

import * as Styled from "./style";

const Th = ({ children }) => {
  return <Styled.Th>{children}</Styled.Th>;
};

Th.prototype = {
  children: propTypes.node.isRequired,
};

export default Th;
